----------------------------------------------
-- 4. 샘플로 유저로그 입력
----------------------------------------------
declare @gameid		varchar(20)
declare @loop		int				set @loop 	= 0
declare @max		int				set @max 	= 5

-- 4-1. 커서선언
declare curSampleLog Cursor for
select gameid from dbo.tSample  

while @loop < @max
	begin
		select '입력횟수:' + ltrim(rtrim(@loop+1))
	
		open curSampleLog
		Fetch next from curSampleLog into @gameid
		while @@Fetch_status = 0
			Begin
				--select @gameid + '입력'
				-- 리스트 입력하기


				Fetch next from curSampleLog into @gameid
			end
		close curSampleLog
						
		
		set @loop = @loop + 1
	end
	
-- 4-3. 커서닫기
Deallocate curSampleLog
